import React from "react";
import FlipCard from '../FlipCard'
import Road from "../Road"
import {Bar, Doughnut, Polar, Radar, HorizontalBar} from 'react-chartjs-2';


function RoadLevel1(props) {
    return (
        <div>
            <div style = {{display: 'flex', flexDirection: 'row'}}>
              <FlipCard
                  width = {"25em"}
                  height = {"15em"}
                  FlipStyle = {{backgroundImage:'url("/chalkboard.jpg")', color:'red'}}
                  Front=
                  {
                    <div 
                    
                    >
                      <h1 className = 'progLang-hF'>
                      {props.plChartData.frontTitle}
                      </h1>
                    </div>
                  }
                  Back = {
                    <div>
                      <Doughnut data={props.plChartData}
                        options= {props.plChartData.options}
                      />
                    </div>
                      }
                >
                </FlipCard>               
                <Road 
                width={'10em'}
                height= {'10em'}
                StylingInfo = {'horizontal-road1'} dashType = 'horizontal-dash'/>
                <Road 
                width={'10em'}
                height= {'10em'}
                StylingInfo = {'horizontal-road1'} dashType = 'horizontal-dash'/>
                <Road 
                width={'10em'}
                height= {'10em'}
                StylingInfo = {'horizontal-road1'} dashType = 'horizontal-dash'/>
                <Road 
                width={'10em'}
                height= {'10em'}
                StylingInfo = {'horizontal-road1'} dashType = 'horizontal-dash'/>
            </div>
            </div>
        )              
}

export default RoadLevel1;
